import React from 'react';
import {FaBars} from 'react-icons/fa';
import { 
    Nav , 
    NavBarContainer,
    NavBarLogo,
    MobileIcon,
    NavMenu,
    NavItem,
    NavLinks
} from './NavbarElements';

const Navbar = () => {
    return (
        <Nav>
            <NavBarContainer>
                <NavBarLogo to='/'>MyBank</NavBarLogo>
                <MobileIcon>
                    <FaBars/>
                </MobileIcon>
                <NavMenu>
                    <NavItem>
                        <NavLinks>About</NavLinks>
                    </NavItem>
                </NavMenu>
            </NavBarContainer>
        </Nav>
    )
}

export default Navbar;
